svg.script:
	  function loopYears(){
	  var years = [1895,1896,1897,1898,1899,1905,1906,1907,1908,1909,1910,1911,1912,1913,1914,1915,1916,1917,1918,1919,1920,1921,1922,1923,1924,1925,1926,1927,1928,1929];
	  var numYears = years.length;
	  function displayYear(year){
			 document.getElementById("Yr"+year).setAttribute('class','shown');
	  }
	  var i =0;
	 var interval = setInterval(function () {   
	 console.log(i);
	 if (i < numYears){
	 	console.log(numYears);
	 	displayYear(years[i]);
		i++
	 } else {
	 clearInterval(interval);
	 }
     }, 500)

	  }
function hovertext(text, x, y){
  	var tooltip = document.getElementById("tooltip");
  	if (x === undefined){
  		tooltip.setAttribute("class","hidden");
  		tooltip.setAttribute("x",0);
  		tooltip.setAttribute("y",0);
  		tooltip.firstChild.data = text;
  	} else {
  		tooltip.setAttribute("x",x);
  		tooltip.setAttribute("y",y);
  		tooltip.firstChild.data = text;
  		tooltip.setAttribute("class","shown");
  	}
  }
